import { useEffect } from "react";
import { useState } from "react";
import { baseUrl } from "../config";


// https://pastebin.com/raw/xdLmcpTU
const CareerCreate = () => {
  const [companyName, setJobOpening] = useState();
  const [companyPosition, setPosition] = useState();
  const [companLocation, setLocation] = useState();
  const [companyDescription, setDescription] = useState();

  const handleSumbit = async () =>{
    try{
      const response = await fetch(`${baseUrl}/job`,{
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          "company": companyName,
          "position": companyPosition,
          "location": companLocation,
          "description": companyDescription,
        })
      })
    } catch (erorr){
      console.log("Got error ", erorr)
    }
  }
  const JobCreateCard = () =>{
    return(
      <div className="w-full py-2 px-4 flex justify-center">
        <h2>Job Creator</h2>
        <form>

        </form>
      </div>
    )
  }
  return (
    <>
      <JobCreateCard></JobCreateCard>
      <input onChange={e => setJobOpening(e.target.value)}/>Enter Company
      <input onChange={e => setPosition(e.target.value)}/>Enter Company
      <input onChange={e => setLocation(e.target.value)}/>Enter Company
      <input onChange={e => setDescription(e.target.value)}/>Enter Company

      <button onClick={handleSumbit}  type="button">Click me</button>
    </>
  );
};

export default CareerCreate;
